
using InstitutionalInterfaceUtilities;
using PPDWebsite.Models;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Net.Mail;
using System.Net.Mime;
using System.Web;

namespace PPDWebsite.App_Code
{
    public class EmailUtilities
    {
        public EmailSettingsModel getEmailSettings()
        {
            EmailSettingsModel emailSettings = new EmailSettingsModel();

            string commandText = "SELECT * FROM EmailSettings";

            Utilities.DatabaseReader reader = new Utilities.DatabaseReader(commandText, "");

            if (reader.Reader == null)
            {
                return emailSettings;
            }

            while (reader.Reader.Read())
            {
                emailSettings.OutgoingServer = reader.Reader["OutgoingServer"].ToString().Trim();
                emailSettings.Sender = reader.Reader["Sender"].ToString().Trim();
                emailSettings.UserName = reader.Reader["Username"].ToString().Trim();
                emailSettings.Password = reader.Reader["Password"].ToString().Trim();
                emailSettings.CC = reader.Reader["CC"].ToString().Trim();
                emailSettings.OutgoingPort = (int)reader.Reader["OutgoingPort"];
                emailSettings.UseSSL = (bool)reader.Reader["UseSSL"];

                break;
            }

            reader.Close();

            return emailSettings;
        }



        public int SendEmail(EmailBundle email)
        {
            EmailSettingsModel es = getEmailSettings();
            int outcome = 0;

            Byte[] bitmapData = Convert.FromBase64String(FixBase64ForImage(GetBase64Image()));
            System.IO.MemoryStream streamBitmap = new System.IO.MemoryStream(bitmapData);
            AlternateView alternateView = new AlternateView(streamBitmap);

            try
            {
                MailMessage mail = new MailMessage(es.Sender, email.recipient);
                SmtpClient client = new SmtpClient();
                client.Port = es.OutgoingPort;
                client.Host = es.OutgoingServer;
                client.EnableSsl = es.UseSSL;
                client.Timeout = 10000;
                client.DeliveryMethod = SmtpDeliveryMethod.Network;
                client.UseDefaultCredentials = false;
                client.Credentials = new System.Net.NetworkCredential(es.UserName, es.Password);

                /*Image embedding
                var imageToInline = new LinkedResource(streamBitmap, MediaTypeNames.Image.Jpeg);
                imageToInline.ContentId = "MyImage";
                 alternateView.LinkedResources.Add(imageToInline);
                mail.AlternateViews.Add(alternateView);
*/
                mail.Subject = email.subject;
                mail.Body = GetEmailHTMLBody(email.body);
                mail.IsBodyHtml = true;

                client.Send(mail);

                outcome = 1;
            }
            catch (Exception ex)
            {
                outcome = 0;
                Utilities.WriteToEventLog("Email sending failed: " + ex.ToString());

            }

            return outcome;
        }

        private string GetEmailHTMLBody(string plainBody)
        {
            string header = GetEmailHeader();
            string signature = GetEmailSignature();

            return header.Replace("XXXXXXXXXXX", plainBody + signature);
        }

        private string GetEmailHeader()
        {
            string header = "<table width='500' align='center'><tbody><tr><td width='500' align='center'><img src ='http://pregnancyprayerguide.com/emailbanner/banner.jpg' alt='' /><div style='text-align:left'><p>XXXXXXXXXXX</p></div></td></tr></tbody></table>";
           
                return header;
        }

        private string GetEmailSignature()
        {
            return "<br /><br />Thank you<br /><br /><b>The Pregnancy Prayer Guide Team</b>";
        }

        private string GetBase64Image()
        {
            return "";
        }

        public static string FixBase64ForImage(string Image)
        {
            System.Text.StringBuilder sbText = new System.Text.StringBuilder(Image, Image.Length);
            sbText.Replace("\r\n", string.Empty); sbText.Replace(" ", string.Empty);
            return sbText.ToString();
        }
    }
}